// MARK: Always Search User Paths (Deprecated)
extension BuildSetting {

    /// Always Search User Paths (Deprecated)
    /// ALWAYS_SEARCH_USER_PATHS
    @available(*, deprecated, message: "This setting is deprecated as of Xcode 8.3 and may not be supported in future versions. It is recommended that you disable the setting.\\n\\nIf enabled, both `#include <header.h>`-style and `#include \"header.h\"`-style directives search the paths in [User Header Search Paths (USER\\_HEADER\\_SEARCH\\_PATHS)](itcaec37c2a6.html#deved642222b) before [Header Search Paths (HEADER\\_SEARCH\\_PATHS)](itcaec37c2a6.html#dev3c9f85d97). As a consequence, user headers, such as your own `String.h` header, have precedence over system headers when using `#include <header.h>`. This is done using the `-iquote` flag for the paths provided in [User Header Search Paths (USER\\_HEADER\\_SEARCH\\_PATHS)](itcaec37c2a6.html#deved642222b). If disabled and your compiler fully supports separate user paths, user headers are only accessible with `#include \"header.h\"`-style preprocessor directives.\\n\\nFor backwards compatibility reasons, this setting is enabled by default. Disabling it is strongly recommended.")
    public static var alwaysSearchUserPathsDeprecated: BuildSetting { 
        BuildSetting(key: .alwaysSearchUserPathsDeprecated, value: "YES")
    }

